import React from 'react'
import {Search} from "@material-ui/icons"

function header() {
    const [user] = useState(JSON.parse(localStorage.getItem('profile')));
    return (
        <div className="w-full flex items-center justify-between bg-blue-600 h-20">
            <h4>Final Proje</h4>
            <div className="flex bg-blue-50 rounded-lg items-center ">
                <input className="flex h-10 rounded-lg p-3 text-gray-900 items-center bor " placeholder="search" type="text"></input>
                <Search/>
            </div>
            {!user ? <div>Login</div> : <div>Logout</div>}
            
        </div>
    )
}

export default header
